import React, { useState } from "react";

function App() {
  const [value, setValue] = useState("");
  const onChangeHandler = (event) => {
    const inputValue = event.target.value;
    setValue(inputValue);
  };
  console.log("value:", value);
  return (
    <div>
      <input type="text" value={value} onChange={onChangeHandler} />
    </div>
  );
}

export default App;
